import path from 'path';

export default async function(page, fileUrl, screenshotsDir) {
  try {
    // Navigate to the HTML file
    await page.goto(fileUrl);
    await page.waitForLoadState('networkidle');

    // Take initial screenshot
    const screenshots = [];
    await page.screenshot({ path: path.join(screenshotsDir, 'step_1_initial.png') });
    screenshots.push(path.join(screenshotsDir, 'step_1_initial.png'));

    // 1. Locate the search input field using its placeholder text and fill it
    const searchInput = page.getByPlaceholder('Search Amazon');
    await searchInput.waitFor({ state: 'visible', timeout: 5000 });
    await searchInput.fill('iPhone');

    await page.screenshot({ path: path.join(screenshotsDir, 'step_2_text_entered.png') });
    screenshots.push(path.join(screenshotsDir, 'step_2_text_entered.png'));

    // 2. Locate the search button. Use an adjacent sibling selector for specificity.
    const searchButton = page.locator('input.search-input + button.search-btn');
    await searchButton.waitFor({ state: 'visible', timeout: 5000 });
    await searchButton.click();

    // 3. Wait for the search results to be displayed on the page
    // The JavaScript on the page will dynamically update the content.
    const resultsHeaderLocator = page.locator('h2:has-text("Search Results for \\"iPhone\\"")');
    await resultsHeaderLocator.waitFor({ state: 'visible', timeout: 5000 });

    await page.screenshot({ path: path.join(screenshotsDir, 'step_3_search_results.png') });
    screenshots.push(path.join(screenshotsDir, 'step_3_search_results.png'));

    // 4. Extract data to verify the action was successful
    const resultsHeaderText = await resultsHeaderLocator.textContent();
    const resultsCountText = await page.locator('div.results-count').textContent();

    return {
      success: true,
      action: "Searched for 'iPhone' and verified results header.",
      extractedData: {
        resultsHeader: resultsHeaderText.trim(),
        resultsCount: resultsCountText.trim()
      },
      screenshots,
      error: null
    };
  } catch (error) {
    return {
      success: false,
      action: "Failed to search for products",
      extractedData: {},
      screenshots: [],
      error: error.message
    };
  }
}
